import React, { Component } from 'react';


class App extends Component {
  componentDidMount() {
    const url = "http://localhost:5000";
    fetch(url)
    .then(res=>{return res.json()})
    .then(response => {
      console.log(response);
    });
  }

  render() {
    <h1>Hello react</h1>
  }
}

export default App;
